import React from 'react';
import './Settings.css';
import { useState } from 'react';

const Settings = () => {

    const [isModalVisible, setIsModalVisible] = useState(false);
    const [settings, setSettings] = useState({
        changePassword: false,
        privacySettings: false,
        notificationPreferences: false,
        twoFactorAuth: false,
        accountActivity: false,
    });

    const openModal = () => {
        setIsModalVisible(true);
    };

    const closeModal = () => {
        setIsModalVisible(false);
    };

    const handleCheckboxChange = (event) => {
        const { name, checked } = event.target;
        setSettings(prevSettings => ({
            ...prevSettings,
            [name]: checked
        }));
    };

    const handleEnableTwoFactorAuth = () => {
        // Logic to enable two-factor authentication
        alert("Two-Factor Authentication Enabled");
    };

    const handleViewAccountActivity = () => {
        // Logic to view account activity
        alert("Viewing Account Activity");
    };



    return (
        <div className="settings-container">
            <h1>Settings</h1>
            <div className="settings-section">
                <h2>Account Settings</h2>
                <div className="setting-option">
                    <label>Change Password</label>
                    <button className="change-btn" onClick={openPasswordModal}>Change</button>
                </div>
                <div className="setting-option">
                    <label>Privacy Settings</label>
                    <button className="edit-btn" onClick={openPrivacyModal}>Edit</button>
                </div>
                <div className="setting-option">
                    <label>Notification Preferences</label>
                    <button className="edit-btn" onClick={openNotificationModal}>Edit</button>
                </div>
            </div>

             {/* Password Modal */}
             {isPasswordModalOpen && (
                <div className="modal">
                    <div className="modal-content">
                        <h2>Change Password</h2>
                        <input type="password" placeholder="Enter new password" />
                        <input type="password" placeholder="Confirm new password" />
                        <button onClick={closePasswordModal}>Save</button>
                        <button onClick={closePasswordModal}>Cancel</button>
                    </div>
                </div>
            )}

            {/* Privacy Modal */}
            {isPrivacyModalOpen && (
                <div className="modal">
                    <div className="modal-content">
                        <h2>Privacy Settings</h2>
                        <label>
                            <input type="checkbox" /> Make my profile private
                        </label>
                        <label>
                            <input type="checkbox" /> Enable two-factor authentication
                        </label>
                        <button onClick={closePrivacyModal}>Save</button>
                        <button onClick={closePrivacyModal}>Cancel</button>
                    </div>
                </div>
            )}

            {/* Notification Modal */}
            {isNotificationModalOpen && (
                <div className="modal">
                    <div className="modal-content">
                        <h2>Notification Preferences</h2>
                        <label>
                            <input type="checkbox" /> Email notifications
                        </label>
                        <label>
                            <input type="checkbox" /> SMS notifications
                        </label>
                        <button onClick={closeNotificationModal}>Save</button>
                        <button onClick={closeNotificationModal}>Cancel</button>
                    </div>
                </div>
            )}



            <div className="settings-section">
                <h2>App Preferences</h2>
                <div className="setting-option">
                    <label>Language</label>
                    <select>
                        <option value="en">English</option>
                        <option value="mk">Macedonian</option>
                        <option value="es">Spanish</option>
                    </select>
                </div>
                <div className="setting-option">
                    <label>Theme</label>
                    <select>
                        <option value="light">Light</option>
                        <option value="dark">Dark</option>
                    </select>
                </div>
            </div>

            <div className="settings-section">
                <h2>Security</h2>
                <div className="setting-option">
                    <label>Two-Factor Authentication</label>
                    <button className="enable-btn">Enable</button>
                </div>
                <div className="setting-option">
                    <label>Account Activity</label>
                    <button className="view-btn">View</button>
                </div>
            </div>
        </div>
    );
};

export default Settings;
